import styles from "./UserTable.module.css"

function UserTable(props) {
    return (
        <div className={styles.card}>
            <table>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>name</th>
                        <th>email</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        props.arr.map((i) => {
                            return (
                                <tr>
                                    <td>{i.id}</td>
                                    <td>{i.name}</td>
                                    <td></td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </div>
    )
}

export default UserTable
